      statusColor: 'text-green-600',
      statusIcon: '●',
      originalContent: '原始图片: 1920x1080像素，包含评分网页面截图',
      nodeProcessing: {
        '解析节点': { 
          status: 'completed', 
          result: '解析成功，提取图片元数据', 
          duration: '14s',
          hasOutput: true,
          outputType: 'metadata',
          outputPreview: '{\n  "width": 1920,\n  "height": 1080,\n  "format": "JPEG",\n  "title": "通过评分网",\n  "text_regions": ["评分", "通过", "4.5/5"],\n  "objects": ["button", "text", "logo"]\n}'
        },
        '清洗节点': { 
          status: 'completed', 
          result: '数据清洗完成', 
          duration: '30s',
          hasOutput: true,
          outputType: 'structured_data',
          outputPreview: '{\n  "score": 4.5,\n  "max_score": 5.0,\n  "status": "通过",\n  "category": "评分网站",\n  "confidence": 0.95,\n  "extracted_text": "评分通过4.5/5"\n}'
