        '增强节点': { 
          status: 'completed', 
          result: '增强处理完成', 
          duration: '15s',
          hasOutput: true,
          outputType: 'enhanced_data',
          outputPreview: '{\n  "score": 4.5,\n  "max_score": 5.0,\n  "status": "通过",\n  "category": "评分网站",\n  "confidence": 0.95,\n  "sentiment": "positive",\n  "keywords": ["评分", "通过", "优秀"],\n  "recommendation": "高质量内容",\n  "enhanced_metadata": {\n    "quality_score": 0.9,\n    "relevance": 0.85\n  }\n}'
        }
